import React, { useState, useEffect } from "react";
import { fetchData } from "../api/fetchApi";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import styles from "./Table.css";

const Tabular = ({ data: { Arunachal, Assam, Manipur, Meghalaya, Mizoram, Nagaland, Tripura } }) => {

    const [fetchedState, setFetchedState] = useState([])

    useEffect(() => {
        const fetchAPIState = async () => {
            const dailyData = await fetchData()
            setFetchedState(dailyData)
        }
        fetchAPIState()
    }, [])

    return (
        <TableContainer component={Paper}>
            <Table className={styles.container} aria-label="simple table">
                <TableHead>
                    <TableRow>
                        <TableCell>State</TableCell>
                        <TableCell className="alert alert-warning" align="right">District</TableCell>
                        <TableCell className="alert alert-success" align="right">Infected</TableCell>

                    </TableRow>
                </TableHead>
                <TableBody>
                    <TableCell component="th" scope="row">
                        {Arunachal}
                    </TableCell>
                    {fetchedState.map(({ Arunachal }, i) => (
                        <TableRow key={i}>

                            <TableCell className="alert alert-warning" align="right">{Arunachal.districtData}</TableCell>
                            <TableCell className="alert alert-success" align="right">{Arunachal.districtData.Lohit.confirmed}</TableCell>

                            {/* <TableCell align="right">{todayCases}</TableCell>
              <TableCell align="right">{todayDeaths}</TableCell> */}

                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    )
}

export default Tabular
